from typing import List


class Solution:
    def canCompleteCircuit(self, gas: List[int], cost: List[int]) -> int:
        tank = 0
        ngas = len(gas)

        for i in range(ngas):
            tank = tank + gas[i] - cost[i]

        if tank < 0:
            return -1


        tank = 0
        start = 0
        for i in range(ngas):
            tank = tank + gas[i] - cost[i]
            if tank<0:
                start=i+1
                tank=0
        return start
        

